--CREATE SCHEMA FP;

/*
	Place DROP comamnds after this comment
	e.g. DROP TABLE
*/
DROP TABLE IF EXISTS FP.CJZ_CUSTOMERS;
DROP TABLE IF EXISTS FP.CJZ_ORDERS;
DROP TABLE IF EXISTS FP.CJZ_ORDER_LINE_ITEMS;
DROP TABLE IF EXISTS FP.CJZ_PRODUCT_INFO;
DROP TABLE IF EXISTS FP.CJZ_SUPPLIER_INFORMATION;

/*
	CREATE comamnds
*/
CREATE TABLE FP.CJZ_CUSTOMERS (
	ID VARCHAR(15) NOT NULL,
	FIRST_NAME VARCHAR(30) NOT NULL,
	LAST_NAME VARCHAR(50) NOT NULL,
	CITY VARCHAR(40) NOT NULL,
	COUNTRY VARCHAR(30) NOT NULL,
	POSTAL_CODE VARCHAR(30) NOT NULL,
);

CREATE TABLE FP.CJZ_ORDERS (
	ORDER_NUMBER VARCHAR(15) NOT NULL,
	ORDER_DATE VARCHAR(10) NOT NULL,
	TOTAL_AMOUNT DECIMAL(8,2) NOT NULL,
	CUSTOMER_ID VARCHAR(15) NOT NULL,
);

CREATE TABLE FP.CJZ_ORDER_LINE_ITEMS (
	ID VARCHAR(15) NOT NULL,
	QTY VARCHAR(4) NOT NULL,
	SALE_PRICE DECIMAL(6,2) NOT NULL,
	ORDER_NUMBER VARCHAR(15) NOT NULL,
	PRODUCT_ID VARCHAR(15) NOT NULL,
);

CREATE TABLE FP.CJZ_PRODUCT_INFO (
	ID VARCHAR(15) NOT NULL,
	ITEM_SOLD VARCHAR(60) NOT NULL,
	RETAIL_PRICE DECIMAL(5,2) NOT NULL,
	PACKAGING VARCHAR(40) NOT NULL,
	IS_DISCONTINUED CHAR(1) NOT NULL,
	SUPPLIER_ID VARCHAR(15) NOT NULL, -- Added through FK_PROD creation
);

CREATE TABLE FP.CJZ_SUPPLIER_INFORMATION (
	ID VARCHAR(15) NOT NULL,
	COMPANY_NAME VARCHAR(60) NOT NULL,
	CONTACT_NAME VARCHAR(50) NOT NULL,
	TITLE VARCHAR(30) NULL,
	COMPANY_CITY VARCHAR(40) NOT NULL,
	COMPANY_COUNTRY VARCHAR(30) NOT NULL,
	PHONE VARCHAR(30) NOT NULL,
	FAX VARCHAR(30) NULL,
);

/*
	ALTER TABLE Relationship KEY comamnds
*/
ALTER TABLE FP.CJZ_CUSTOMERS ADD CONSTRAINT PK_CUST PRIMARY KEY (ID);
ALTER TABLE FP.CJZ_ORDERS ADD CONSTRAINT PK_ORD PRIMARY KEY (ORDER_NUMBER);
ALTER TABLE FP.CJZ_ORDER_LINE_ITEMS ADD CONSTRAINT PK_ORD_LINE PRIMARY KEY (ID);
ALTER TABLE FP.CJZ_PRODUCT_INFO ADD CONSTRAINT PK_PROD PRIMARY KEY (ID);
ALTER TABLE FP.CJZ_SUPPLIER_INFORMATION ADD CONSTRAINT PK_SUP PRIMARY KEY (ID);

ALTER TABLE FP.CJZ_ORDERS ADD CONSTRAINT FK_ORD FOREIGN KEY (CUSTOMER_ID) REFERENCES FP.CJZ_CUSTOMERS (ID);
ALTER TABLE FP.CJZ_ORDER_LINE_ITEMS ADD CONSTRAINT FK_ORD_LINE_ORD FOREIGN KEY (ORDER_NUMBER) REFERENCES FP.CJZ_ORDERS (ORDER_NUMBER);
ALTER TABLE FP.CJZ_ORDER_LINE_ITEMS ADD CONSTRAINT FK_ORD_LINE_PROD FOREIGN KEY (PRODUCT_ID) REFERENCES FP.CJZ_PRODUCT_INFO (ID);
ALTER TABLE FP.CJZ_PRODUCT_INFO ADD CONSTRAINT FK_PROD FOREIGN KEY (SUPPLIER_ID) REFERENCES FP.CJZ_SUPPLIER_INFORMATION (ID);

