/*
	Answers to the query questions
*/
SELECT *
FROM FP.CJZ_SUPPLIER_INFORMATION
WHERE FAX IS NULL
ORDER BY PHONE;

SELECT prod.ITEM_SOLD, prod.RETAIL_PRICE
FROM FP.CJZ_PRODUCT_INFO AS prod
JOIN FP.CJZ_SUPPLIER_INFORMATION AS sup ON prod.SUPPLIER_ID = sup.ID
WHERE sup.FAX IS NULL AND prod.RETAIL_PRICE > 40.00
ORDER BY prod.RETAIL_PRICE;

SELECT o.ORDER_NUMBER, c.FIRST_NAME, c.LAST_NAME, o.ORDER_DATE, prod.ITEM_SOLD, ol.QTY, ol.SALE_PRICE
FROM FP.CJZ_ORDERS AS o
JOIN FP.CJZ_CUSTOMERS AS c ON o.CUSTOMER_ID = c.ID
JOIN FP.CJZ_ORDER_LINE_ITEMS AS ol ON o.ORDER_NUMBER = ol.ORDER_NUMBER
JOIN FP.CJZ_PRODUCT_INFO AS prod ON ol.PRODUCT_ID = prod.ID
WHERE o.TOTAL_AMOUNT > 4000.00
ORDER BY ol.QTY;

SELECT c.FIRST_NAME, c.LAST_NAME, c.CITY, c.COUNTRY, c.POSTAL_CODE, o.ORDER_NUMBER, o.ORDER_DATE, o.TOTAL_AMOUNT, ol.QTY, ol.SALE_PRICE, prod.ITEM_SOLD, prod.RETAIL_PRICE, prod.PACKAGING, prod.IS_DISCONTINUED, sup.COMPANY_NAME, sup.CONTACT_NAME, sup.TITLE, sup.COMPANY_CITY, sup.COMPANY_COUNTRY, sup.PHONE, sup.FAX
FROM FP.CJZ_ORDERS AS o
JOIN FP.CJZ_CUSTOMERS AS c ON o.CUSTOMER_ID = c.ID
JOIN FP.CJZ_ORDER_LINE_ITEMS AS ol ON o.ORDER_NUMBER = ol.ORDER_NUMBER
JOIN FP.CJZ_PRODUCT_INFO AS prod ON ol.PRODUCT_ID = prod.ID
JOIN FP.CJZ_SUPPLIER_INFORMATION AS sup ON prod.SUPPLIER_ID = sup.ID
ORDER BY o.ORDER_NUMBER;

