-- To see all their orders (this helps us to know which customers have a total amount spent for ALL of their orders that is greater than $1000. We can add the total amount for each person in our head, and in the next block of code [which is to be regarded as the answer for the EC question], see that total amount spent across all orders for each customer
-- Commented it out since it was to check

-- Actual EC code answer [the above code was just to check]:
SELECT c.FIRST_NAME, c.LAST_NAME, SUM(o.TOTAL_AMOUNT) AS TOTAL_SPENT_FOR_ORDERS
FROM FP.CJZ_ORDERS AS o
JOIN FP.CJZ_CUSTOMERS AS c ON o.CUSTOMER_ID = c.ID
WHERE c.COUNTRY = 'France'
GROUP BY c.ID, c.FIRST_NAME, c.LAST_NAME
HAVING SUM(o.TOTAL_AMOUNT) > 1000.00
ORDER BY c.ID;